import React, { useRef, useEffect, useState, useContext } from 'react'
import './ImageElement.css'
import '../../Project/Styles/Spacing.css'

export const ImageElement = (props) => {
  const maxWidht =
    props.maxWidht == 'full' ? (
      <h1>{props.text}</h1>
    ) : props.maxWidht == 'lcr' ? (
      <h2>{props.text}</h2>
    ) : props.maxWidht == 'c' ? (
      <h3>{props.text}</h3>
    ) : props.maxWidht == 'v1' ? (
      <h4>{props.text}</h4>
    ) : props.maxWidht == 'h5' ? (
      <h5>{props.text}</h5>
    ) : props.maxWidht == 'h6' ? (
      <h6>{props.text}</h6>
    ) : props.maxWidht == 'p' ? (
      <p>{props.text}</p>
    ) : props.maxWidht == 'c' ? (
      <p className="caption">{props.text}</p>
    ) : props.maxWidht == 't' ? (
      <p className="t">{props.text}</p>
    ) : (
      props.maxWidht
    )

  //   const maxWidht = props.maxWidht

  const imageStyle = {
    maxWidht: { maxWidht },
  }
  return (
    <img
      style={imageStyle}
      className="image-ie"
      src={props.image}
      alt="image"
    />
  )
}
